import TodoItem from "./TodoItem";
import todos from "./todos.json";
const TodoList = () => {
  return(
        <ul>
            {
      todos.map(todo => {
        return(<TodoItem todo={todo} key={todo}/>);
      })
  }
        </ul>
    );
}
export default TodoList;
